Eu desde criança, meu Pai Joaquim Fonseca (in memorian), quando alguém falava com ele, vc tá "duro igual um coco"(muito forte), ele brincava com a pessoa, que iria FICAR PRA SEMENTE, ou seja, não iria morrer! Claro que ele tava brincando e caçoando a pessoa! E hoje, eu entendo isso, e brinco tbm, falando que eu vou ficar pra semente! E O QUE É UMA SEMENTE? É o futuro que vc tá plantando na vida dos seus filhos, netos, amigos,etc, através das suas atitudes, sejam boas ou ruins! Vc plantou coisas boas na vida, regou,cuidou, vc vai colher e comer aqueles frutos, e consequentemente vai ter a semente (a renovação) para fazer uma nova plantação! Então depois que vc partir, seu filho,neto ou amigo, vai se inspirar na sua colheita, e vai fazer que a sua plantação, seja muito produtiva, pra passar de geração em geração! 😉😉
